import React from 'react';
import ReactDOM from 'react-dom';
import { ProgressPlugin } from 'webpack';
import './index.css';


function Rapper() {
    return <h1>{props.nome}</h1>;
}

function App() {
    <div>
        <Rapper nome="Jay-Z" /> 
        <Rapper nome="Kanye West" /> 
        <Rapper nome="Tupac" /> 
        <Rapper nome="Nas" /> 


    </div>
}
